import React from "react";

import "bootstrap/dist/css/bootstrap.min.css";
import "./Articles.css";
import NavBar from "../../components/Navigation";
import Footer from "../../components/Footer";
import ArticlesCard from "../../components/articlesCard/ArticlesCard";
import Categories from "../../components/Categories/Categories";

function Articles({ articleList, categoryList }) {
  let articleCards = [];
  articleList.every((item) =>
    articleCards.push(<ArticlesCard theArticle={item} />)
  );
  return (
    <div>
      <div>
        <NavBar />
      </div>
      <div className="ArticlesContentsStyle">
        <div className="ArticlesTextContentsStyle">
          <p>Anasayfa</p>
          <p>&nbsp;/&nbsp;</p>
          <p>Makaleler</p>
        </div>
      </div>

      <div className="ArticlesInnerContentsStyle1">
        <div className="ArticleContainer">{articleCards}</div>
        <div className="CategoryContainer">
          <Categories categoryList={categoryList}></Categories>
        </div>
      </div>

      <div>
        <Footer />
      </div>
    </div>
  );
}

export default Articles;
